import DeviceList from './components/DeviceList';
import Login from './components/Login';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/devices" element={<DeviceList />} />
      </Routes>
    </Router>
  );
}

export default App;
